import './App.css';
import axios from 'axios'; //untuk hubungin api backend dengan frontend
import { useEffect, useState } from 'react'; // untk menjalankan sebuah perintah dari API dengan ada dependencies
import { BrowserRouter as Router,Route, Switch } from 'react-router-dom';
import Home from "./pages/Home";


// disini bakal ada structure routenya aja

function App() {


  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path='/' exact component={Home}/>
        </Switch>
      </Router>


    </div>
  );
}

export default App;
